import {Add, Sub, Div, Mul} from './Heading';



    function App(){
        return <div>         
            <ul>
                <li>{Add(2,3)}</li>
                <li>{Sub(2,3)}</li>
                <li>{Div(2,3)}</li>
                <li>{Mul(2,3)}</li>
            </ul>
        </div>;
    }

    export default App;
